import React, { Component } from 'react';

class Userprofile extends Component {

  componentDidMount(){
    console.log(this.props);
  }
  render() {
    return (
     <div>
        <h2>Name : {this.props.user}</h2>
        
     </div>

    );
  }
}

export default Userprofile;
